import React from "react";
import { View, Text, Heading, Center, NativeBaseProvider,Stack, Container, Image } from "native-base";





const AboutCinema = () => {
    return(
            <Container safeArea flex={1} bgColor={'amber.100'}>
                <Center>
                    // load popi.gif from resources
                    <Image source={{uri: 'https://popcornandcandy.com/assets/output-onlinegiftools.gif'}} alt="Loading" />

                    <Heading> About Cinema</Heading>
            
                </Center>
            </Container>

    )
};

export default AboutCinema;
